import React from 'react';
import Profile from './Profile';

const App = () => {
  const user = {
    "name": "Iroh",
    "tag": "@iroh",
    "location": "New York, USA",
    "avatar": "https://i.pinimg.com/originals/09/92/3b/09923b7849459ce6539a999f946a9a6c.png",
    "stats": {
      "followers": 987,
      "views": 12456,
      "likes": 4321
    }
  };

  return (
    <div>
      <Profile
        username={user.name}
        tag={user.tag}
        location={user.location}
        avatar={user.avatar}
        stats={user.stats}
      />
    </div>
  );
};

export default App;
